-- Table structure for general_information
-- ----------------------------
DROP TABLE IF EXISTS `general_information`;
CREATE TABLE `general_information`  (
  `q1` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '单位名称',
  `q2` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '研究编号',
  `q3` date NULL DEFAULT NULL COMMENT '调查日期',
  `q4` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '调查员',
  `q5` date NULL DEFAULT NULL COMMENT '1.出生日期',
  `q6` int(0) NULL DEFAULT NULL COMMENT '2.年龄（岁）',
  `q7` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '3.性别（男1女2）',
  `q8` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '4.民族（汉1，其他2）',
  `q9` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '4.民族（“其他”附带）',
  `q10` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '5.籍贯（爷爷出生地）',
  `q11` int(0) NULL DEFAULT NULL COMMENT '6.身高（cm)',
  `q12` int(0) NULL DEFAULT NULL COMMENT '体重（kg）',
  `q13` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '7.婚姻状况（未婚：1，已婚：2，离异/分居：3，丧偶：4，其他：5）',
  `q14` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '8.是否吸烟（否：1，是，请回答以下问题：2）',
  `q15` int(0) NULL DEFAULT NULL COMMENT '吸烟（年）',
  `q16` int(0) NULL DEFAULT NULL COMMENT '平均每天抽烟（根数）',
  `q17` int(0) NULL DEFAULT NULL COMMENT '戒烟（年）',
  `q18` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '9.是否喝酒：（否：1，偶尔：2，经常：3）',
  `q19` int(0) NULL DEFAULT NULL COMMENT '饮酒（年）',
  `q20` int(0) NULL DEFAULT NULL COMMENT '平均每天饮酒（两）',
  `q21` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '10.是否有精神疾病家族史：（否：1，是，（注明关系）：2）',
  `q22` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '10.是否有精神疾病家族史：（“是，（注明关系）”附带）',
  `q23` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '11.教育程度：（博士：1，硕士：2，大学本科：3，大专：4，中专及高中：5，初中：6，小学：7，其他：8）',
  `q24` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '12.居住情况，与其共同生活的人（配偶：1，其他亲属：2，独居：3，其他：4）',
  `q25` int(0) NULL DEFAULT NULL COMMENT '1.首次发病年龄（岁）',
  `q26` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '2.此次调查是首发还是再发：（首发：1，复发：2）',
  `q27` int(0) NULL DEFAULT NULL COMMENT '3.发病至今有多长时间（月）',
  `q28` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '4.根据DSM-IV是否诊断为精神分裂症？（是：1，否：2）',
  `q29` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '5.是否伴随严重的躯体疾病或并发症，以及酗酒、药物滥用等？（是：1，否：2）',
  `q30` date NULL DEFAULT NULL COMMENT '6.收集血样日期',
  `q31` int(0) NULL DEFAULT NULL COMMENT '住院次数（包括本次）',
  `q32` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '1.患者是否初次使用抗精神病药物（是：1，否，请回答：2）',
  PRIMARY KEY (`q2`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

